(window.webpackJsonp=window.webpackJsonp||[]).push([[9],{"16l3":function(A,e,n){"use strict";n.r(e),n.d(e,"default",(function(){return g}));var a=n("AIc5"),t=n("q1tI"),i=n.n(t),s=n("Bl7J"),r=n("RTHJ"),l=n.n(r);function g(){var A=a.data;return i.a.createElement(s.a,null,i.a.createElement("h1",null,"Meine Projekte"),i.a.createElement("p",null,"Hier ist eine kleine Auswahl meiner Projekte."),i.a.createElement("ol",null,A.allMarkdownRemark.edges.map((function(A){return i.a.createElement("li",{className:l.a.projects},i.a.createElement("h3",null,A.node.frontmatter.title),i.a.createElement("div",{dangerouslySetInnerHTML:{__html:A.node.html}}))}))))}},AIc5:function(A){A.exports=JSON.parse('{"data":{"allMarkdownRemark":{"edges":[{"node":{"frontmatter":{"title":"Kindertagespflege Löwenzahn"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Website Kita Löwenzahn\\"\\n        title=\\"Website Kita Löwenzahn\\"\\n        src=\\"/static/c76b66e89210780dd18812ce9788ed3d/4b190/Website_Kita_Loew_web1.jpg\\"\\n        srcset=\\"/static/c76b66e89210780dd18812ce9788ed3d/e07e9/Website_Kita_Loew_web1.jpg 200w,\\n/static/c76b66e89210780dd18812ce9788ed3d/066f9/Website_Kita_Loew_web1.jpg 400w,\\n/static/c76b66e89210780dd18812ce9788ed3d/4b190/Website_Kita_Loew_web1.jpg 800w,\\n/static/c76b66e89210780dd18812ce9788ed3d/a2510/Website_Kita_Loew_web1.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Die anfängliche <strong>Ist-Situation und Konkurrenzanalyse</strong> zeigte mir, dass man mit Informationen auf der Seite, nach denen Eltern häufig fragen, sich gut abheben kann, zudem wurden kleinere Animationen und ein buntes <strong>Farbkonzept</strong> als Blickfang eingeplant. Es sollte alles Wichtige auf einen Blick sichtbar und informativ sein, Termine und Aktionen sollten selber aktualisiert werden können.</p>\\n<p>Das Logo für die Kita wurde zuerst digital gezeichnet, aber auch schnell <strong>wieder verworfen</strong> - Pixelgrafiken sehen zwar authentischer aus, lassen sich aber nicht wie Vektorgrafiken skalieren. Auch der Hauptteil der Seite verlief ursprünglich gerade senkrecht durch die Seite, das haben allerdings schon viele und somit entschied ich, den mittleren Content einfach leicht anzuwinkeln und ihm das Aussehen eines Blatt Papieres zu geben.</p>\\n<p>Das kinderfreundliche Gesamtbild, die wichtigsten Informationen auf einen Blick, das Kontaktformular und gute <strong>SEO</strong> brachten der Seite bis heute <strong>beste Präsenz</strong> in der lokalen Region, bei suchenden Müttern und auch im Google-Ranking.</p>\\n<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Logo Kita Löwenzahn\\"\\n        title=\\"Logo Kita Löwenzahn\\"\\n        src=\\"/static/72434937dbaa4de9c95938f4ce7abfaa/4b190/Loew_logovergleich.jpg\\"\\n        srcset=\\"/static/72434937dbaa4de9c95938f4ce7abfaa/e07e9/Loew_logovergleich.jpg 200w,\\n/static/72434937dbaa4de9c95938f4ce7abfaa/066f9/Loew_logovergleich.jpg 400w,\\n/static/72434937dbaa4de9c95938f4ce7abfaa/4b190/Loew_logovergleich.jpg 800w,\\n/static/72434937dbaa4de9c95938f4ce7abfaa/d7ad1/Loew_logovergleich.jpg 1001w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Das ursprüngliche Logo (li.) wurde zugunsten des flexibleren Vektorlogos wieder verworfen.</p>\\n<div style=\\"text-align: right\\">Joomla! | HTML5 | CSS3</div>"}},{"node":{"frontmatter":{"title":"Eigene Website"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Meine alte Website\\"\\n        title=\\"Meine alte Website\\"\\n        src=\\"/static/2995b65be652327013e615fb34c10578/4b190/WebDevDesign_Website.jpg\\"\\n        srcset=\\"/static/2995b65be652327013e615fb34c10578/e07e9/WebDevDesign_Website.jpg 200w,\\n/static/2995b65be652327013e615fb34c10578/066f9/WebDevDesign_Website.jpg 400w,\\n/static/2995b65be652327013e615fb34c10578/4b190/WebDevDesign_Website.jpg 800w,\\n/static/2995b65be652327013e615fb34c10578/a2510/WebDevDesign_Website.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Das ist meine alte Website, von Anfang an habe ich an dieser geübt, programmiert, verworfen und immer wieder neu hochgezogen oder erneuert. Aber sie hatte leider keine https-Verschlüsselung und als uralte Inklusivdomain zu meinem alten Vertrag, wollte man sie auch nicht einfach so umschalten - jetzt wird sie durch eine mit modernerer Codetechnologie ersetzt, an der ich ab sofort weiter programmieren und lernen werde.</p>\\n<p>Die Seite wurde von mir zu Anfang in HTML, CSS und JQuery erstellt, nach einiger Zeit und mehr Erfahrung stellte ich die Codestuktur auf das modernere HTML5, CSS3 um und JQuery wurde reines JavaScript ersetzt - auch Animationen wurden dort an einigen Stellen eingebracht und der Parallax-Effekt durfte auch nicht fehlen.</p>\\n<div style=\\"text-align: right\\">HTML5 | CSS3 | JavaScript</div>"}},{"node":{"frontmatter":{"title":"Website Küchenstudio"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"alte Website für ein Küchenstudio\\"\\n        title=\\"alte Website für ein Küchenstudio\\"\\n        src=\\"/static/3af297eb51d7a4522d680b66004f2b5b/4b190/WebsiteMockup_Kuechenexkl.jpg\\"\\n        srcset=\\"/static/3af297eb51d7a4522d680b66004f2b5b/e07e9/WebsiteMockup_Kuechenexkl.jpg 200w,\\n/static/3af297eb51d7a4522d680b66004f2b5b/066f9/WebsiteMockup_Kuechenexkl.jpg 400w,\\n/static/3af297eb51d7a4522d680b66004f2b5b/4b190/WebsiteMockup_Kuechenexkl.jpg 800w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Eine ältere Website für ein Küchenstudio bei der es zu Anfang darauf ankam, sich selbst zu mit den Herstellern zu präsentieren und ein paar seiner eigenen Projekte zu zeigen. Dafür rutschte die übliche Slideshow eine Stufe nach unten und das Logo mit den Marken nach oben in den Fokus. Später kamen noch eigene Videos hinzu, die auch noch eingebunden wurden. Die Projekte wurden als Grid angelegt und man konnte mit einem Klick Modalboxen öffnen, die genauere Beschreibungen enthielten.</p>\\n<p>Die Seite wurde als eine Art \\"Visitenkarte\\" angelegt, da keine Inhalte selber eingestellt werden sollten, also musste ein CMS, wie Joomla!, dafür nicht eingerichtet werden.</p>\\n<div style=\\"text-align: right\\">HTML5 | CSS3 | JavaScript</div>"}},{"node":{"frontmatter":{"title":"Moorland Festival"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto; max-width: 800px; \\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"Website Kita Löwenzahn\\"\\n        title=\\"Website Kita Löwenzahn\\"\\n        src=\\"/static/61f97020639e470ed1ee217a568980fa/4b190/MoorlandFestivalWebsite1.jpg\\"\\n        srcset=\\"/static/61f97020639e470ed1ee217a568980fa/e07e9/MoorlandFestivalWebsite1.jpg 200w,\\n/static/61f97020639e470ed1ee217a568980fa/066f9/MoorlandFestivalWebsite1.jpg 400w,\\n/static/61f97020639e470ed1ee217a568980fa/4b190/MoorlandFestivalWebsite1.jpg 800w,\\n/static/61f97020639e470ed1ee217a568980fa/a2510/MoorlandFestivalWebsite1.jpg 1000w\\"\\n        sizes=\\"(max-width: 800px) 100vw, 800px\\"\\n        style=\\"width:100%;height:100%;margin:0;vertical-align:middle;position:absolute;top:0;left:0;\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<p>Für das Moorland-Festival in Ladbergen habe ich 2019 Website und diverse Werbemittel gestaltet, es musste vor allem auf die ursprünglichen Farben Schwarz und Gelb/Orange geachtet werden. Man sah jedoch recht schnell, dass das Schwarz zu schwer war und man mit einem dunkleren, schmutzigem braunton flexibler war. Auch das alte Logo war für große Größen zu verpixelt, das habe ich dem Zuge vektorisiert und die Buchstaben neu zugerichtet.</p>\\n<p>Die Website habe ich rein in HTML, CSS und etwas JavaScript erstellt, da der alte Serveraccount keine Datenbank mit drin hatte, das war auch nicht nötig, da die Pflege der Website in meinen Händen bleiben sollte, so brauchte man keine Module dazukaufen und es blieb später mehr Spendengeld über.</p>\\n<div style=\\"text-align: right\\">HTML5 | CSS3 | JavaScript</div>"}}]}}}')},RTHJ:function(A,e,n){A.exports={projects:"projects-module--projects--1Su_P"}}}]);
